import './App.css';

const requestOptions = {
    method: 'POST',
    headers: { 'Content-Type': 'application/json' },
    body: JSON.stringify({url: 'https://www.youtube.com/watch?v=slGLbp70TiQ&ab_channel=VeibaeCrumbs'})
};

async function fetchData() {
    const response = await fetch('http://localhost:3001/download/mp3', requestOptions);
    const data = await response.json();
    console.log(data.title)
}

function App() {
    return (<div>
        <h1>Youtube MP3 Downloader</h1>
        <input type="text" placeholder="Youtube link" />
        <br/>
        <button onClick={fetchData}>Download</button>
    </div>)
}

export default App;
